import React from "react"
import "./styles.css"
import Contacts from "./test"
import { ContactChip } from "../../Components"

const StyledList = () => {
	return (
		<div className="List">
			{
				Contacts.map((contact) => {
					return <ContactChip props={contact}>{contact.name}</ContactChip>
				}) 
			}
		</div>
	)
}

export { StyledList }
